import React from 'react'

const TodoForm = () => {
	const handleSubmit = (e) => {
		e.prevent.default()
	}

	return (
		<form onSubmit={handleSubmit}>
			<input type="text" />
			<button>Submit</button>
		</form>
	)
}

export default TodoForm
